import React from "react";
import "./ToDoItem.css";
import {
  Row,
  Col,
  Card,
  Form,
  Input,
  DatePicker,
  Layout,
  Button,
  Modal,
} from "antd";
const ToDoItem = (props) => {
  return (
    <Card className="to-do-item">
      <p className="to-do-text">{props.text}</p>
      <p
        className="to-do-remover"
        onClick={() => {
          props.onChecked(props.id);
        }}
      >
        X
      </p>
    </Card>
  );
};

export default ToDoItem;
